	XXMatrixAdd (&m_M[135], &m_M[124], &m_M[122]);

	/* GravityCompensation\Mux\port.e[5] = GravityCompensation\Joint12\uTbai\p1.e; */
	m_M[214].mat[4] = m_V[727];

